            if not sentence:
                subject = triple.subject
                sentence += f"{subject} has a runway length of {triple.object} meters."
            else:
                sentence += f" with a runway length of {triple.object} meters."
        elif triple.predicate == "runwayName":
            if not sentence:
                subject = triple.subject
                sentence += f"{subject} has a runway name of {triple.object}."
            else:
                sentence += f" and has a runway name of {triple.object}."
        elif triple.predicate == "isPartOf":
            if not sentence:
                subject = triple.subject
                sentence += f"{subject} is part of {triple.object}."
            else:
